import React from "react";

const Post = (props) => {
  return (
    <div className="post">
      <div className="img-thumb">
        <img src="https://placeimg.com/200/150/tech" />
      </div>
      <div className="content">
        <div className="title">{props.title}</div>
        <div className="desc">{props.desc}</div>
      </div>
    </div>
  );
};

export default Post;
